import React from "react";
import Tagline from "../../TagLine/Tagline";
import { useState, useEffect } from "react";

import { fetchTagline, updatePost } from "../../Api/index";

const TaglineAdmin = () => {
  const [taglineData, setTaglineData] = useState({
    title: "",
    tagId: 1234,
    changableText: "",
    description: "",
    image: "",
  });

  const onload = async () => {
    const {
      title,
      tagId,
      changableText,
      description,
      image,
    } = await fetchTagline();
    setTaglineData({
      title: title,
      tagId: tagId,
      changableText: changableText,
      description: description,
      image: image,
    });
  };

  useEffect(() => {
    onload();
  }, []);
  console.log(taglineData);

  const handleSubmit = (e) => {};
  return (
    <div className="tagline-part container">
      <p>
        <button
          class="btn btn-primary"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#collapseExample"
          aria-expanded="false"
          aria-controls="collapseExample"
        >
          Tagline preview
        </button>
      </p>
      <div class="collapse preview" id="collapseExample">
        <Tagline />
      </div>

      <form>
        <div className="custom-file">
          <input
            type="file"
            className="custom-file-input"
            id="inputGroupFile01"
            aria-describedby="inputGroupFileAddon01"
          />
          <label className="custom-file-label" htmlFor="inputGroupFile01">
            Choose file
          </label>
        </div>
        <div className="input-group mb-3">
          <input
            type="text"
            className="form-control"
            placeholder="tagline"
            aria-label="tagline"
          />

          <input
            type="text"
            className="form-control"
            placeholder="Changable words(use comma , between words)"
            aria-label="Changable words"
          />
        </div>
        <div class="input-group">
          <span class="input-group-text">Description</span>
          <textarea class="form-control" aria-label="With textarea"></textarea>
        </div>
        <button type="button" class="btn btn-outline-primary submit_button">
          Set
        </button>
      </form>
    </div>
  );
};

export default TaglineAdmin;
